import React from "react"
import Flexbox from "flexbox-react"

import "./Chats.css"

function Chats () {
  return (
    <Flexbox className="chats" flexDirection="column">
      <Chatheader />
      <Chatlist />
      <Chattextfield />
    </Flexbox>
  )
}

const Chatheader = () => (
  <div className="chat-header">
    Chatheader
  </div>
)

function Chatlist () {
  const items = [...Array(100)].map((val, i) => `Item ${i}`)

  return (
    <div className="chat-list">
      <ul>
        {items.map((item, i) => (<li key={`item_${i}`}>{ item }</li>))}
      </ul>
    </div>
  )
}

function Chattextfield () {
  return (
    <Flexbox className="chat-textfield" flexDirection="row">
      <Flexbox flexGrow={1}>
        <form>
          <input type="text" className="chat-input"/>
        </form>
      </Flexbox>
      <button className="chat-inputbutton"> Send </button>
    </Flexbox>
  )
}


export default Chats
